import { useState } from "react";

function Home() {
    const [accounts, setAccounts] = useState([]);

    useEffect(() => {
            fetch("/a-service/v1/accounts/1")
              .then(res => res.json())
              .then(
                (result) => {
                  setAccounts(result)
                },
                (error) => {
                  console.log(error)
                }
              )
      }, [])

    return (
        <div>
            <table class="table">
  <thead class="thead-dark">
    <tr>
      <th scope="col">#</th>
      <th scope="col">Account</th>
      <th scope="col">Balance</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      {accounts.map(account=>
      <th>
        <td>{account.id}</td>
        <td>{account.accountType}</td>
        <td>{account.balance}</td>
     </th>
      )

      }
    </tr>
  </tbody>
</table>
        </div>
      );
    }
    export default Home;
